description:
Quarantine got you bogged down? Yeah well, we're pretty much on the same boat. But we thought this would be a good time to dig deep into our archives and share some never before seen footage!  Come with us on a journey to our first international sold out show in Dubai and follow it up with live performances in Abu Dhabi and Manipal! Watch us get candid in some behind the scenes with Under25 and Bharath M Devaraj (@whoismd)! Happy to be sharing this experience with ya'll! Enjoy :)
#jordindian #live #UAE

LIKE SHARE & SUBSCRIBE FOR MORE 

Shot & Edited By: Kevin Zombi Joseph (Abstract Void)

Poster Credits - Maryann Vincent

